import React from "react";
import { Nav, Link } from 'react-router-dom'
import { Button, Navbar } from "@nextui-org/react";

const Header = () => {
  return (
    <Navbar variant="floating" isBordered>
      <Navbar.Brand>
        <Link href="/">
          Shoppping
        </Link>
      </Navbar.Brand>
      <Navbar.Content>
        <Navbar.Link>
          <Button as={Link} href="/cart" auto css={{ padding: "$4" }} light>
            <div>Привет</div>
          </Button>
        </Navbar.Link>
      </Navbar.Content>
    </Navbar>
  )
}

export default Header;
